    true,nt"url": null,nt"notes": "<p>This is an RSS Feed of Food Safety information
    thatu2019s produced in real-time by the CDC. This RSS feed is the integration of
    two other XML feeds, one from the USDA's Food Safety Inspection Service (FSIS) -
    <a href="http://www.fsis.usda.gov/RSS/usdarss.xml">http://www.fsis.usda.gov/RSS/usdarss.xml</a>
    - and one from the FDA's Food Safety Recalls - <a href="http://www.fda.gov/AboutFDA/ContactFDA/StayInformed/RSSFeeds/FoodSafety/rss.xml">http://www.fda.gov/AboutFDA/ContactFDA/StayInformed/RSSFeeds/FoodSafety/...</a>.
